import{_ as t,a as o,b as a,c as i,d as l,e as r,f as s,g as n,h as d,i as p}from"./chunks/vscode_intellisense.CXZ8jIR2.js";import{_ as c,c as u,a8 as h,o as m}from"./chunks/framework.BDnHobkS.js";const P=JSON.parse('{"title":"비주얼 스튜디오 코드 IDE(VSCode)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/dev_setup/vscode.md","filePath":"ko/dev_setup/vscode.md"}'),g={name:"ko/dev_setup/vscode.md"};function f(b,e,k,v,_,w){return m(),u("div",null,e[0]||(e[0]=[h('<h1 id="비주얼-스튜디오-코드-ide-vscode" tabindex="-1">비주얼 스튜디오 코드 IDE(VSCode) <a class="header-anchor" href="#비주얼-스튜디오-코드-ide-vscode" aria-label="Permalink to &quot;비주얼 스튜디오 코드 IDE(VSCode)&quot;">​</a></h1><p><a href="https://code.visualstudio.com/" target="_blank" rel="noreferrer">Visual Studio Code</a> is a powerful cross-platform source code editor/IDE that can be used for PX4 development on Ubuntu, Windows, and macOS.</p><p>PX4 개발에 VSCode를 사용하는 데에는 많은 이유가 있습니다.</p><ul><li>Getting setup <em>really</em> only takes a few minutes.</li><li>A rich extension ecosystem that enables a huge range of tools needed for PX4 development: C/C++ (with solid <em>cmake</em> integration), <em>Python</em>, <em>Jinja2</em>, ROS messages, and even DroneCAN dsdl.</li><li>뛰어난 Github 통합 기능</li></ul><p>IDE를 설정과 개발 방법에 대하여 설명합니다.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>There are other powerful IDEs, but they typically take more effort to integrate with PX4. With <em>VScode</em>, configuration is stored in the PX4/PX4-Autopilot tree (<a href="https://github.com/PX4/PX4-Autopilot/tree/main/.vscode" target="_blank" rel="noreferrer">PX4-Autopilot/.vscode</a>) so the setup process is as simple as adding the project folder.</p></div><h2 id="전제-조건" tabindex="-1">전제 조건 <a class="header-anchor" href="#전제-조건" aria-label="Permalink to &quot;전제 조건&quot;">​</a></h2><p>You must already have installed the command line <a href="./../dev_setup/dev_env.html">PX4 developer environment</a> for your platform and downloaded the <em>Firmware</em> source code repo.</p><h2 id="installation-setup" tabindex="-1">Installation &amp; Setup <a class="header-anchor" href="#installation-setup" aria-label="Permalink to &quot;Installation &amp; Setup&quot;">​</a></h2><ol><li><p><a href="https://code.visualstudio.com/" target="_blank" rel="noreferrer">Download and install VSCode</a> (you will be offered the correct version for your OS).</p></li><li><p>Open VSCode and add the PX4 source code:</p><ul><li>Select <em>Open folder ...</em> option on the welcome page (or using the menu: <strong>File &gt; Open Folder</strong>): <img src="'+t+'" alt="Open Folder"></li><li>A file selection dialog will appear. Select the <strong>PX4-Autopilot</strong> directory and then press <strong>OK</strong>.</li></ul><p>The project files and configuration will then load into <em>VSCode</em>.</p></li><li><p>Press <strong>Install All</strong> on the <em>This workspace has extension recommendations</em> prompt (this will appear on the bottom right of the IDE). <img src="'+o+'" alt="Install extensions"></p><p>VSCode will open the <em>Extensions</em> panel on the left hand side so you can watch the progress of installation.</p><p><img src="'+a+'" alt="PX4 loaded into VSCode Explorer"></p></li><li><p>오른쪽 하단에 여러 알림/프롬프트가 나타날 수 있습니다.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If the prompts disappear, click the little &quot;alarm&quot; icon on the right of the bottom blue bar.</p></div></li></ol><p>:::</p><ul><li>If prompted to install a new version of <em>cmake</em>: <ul><li>Say <strong>No</strong> (the right version is installed with the <a href="./../dev_setup/dev_env.html">PX4 developer environment</a>).</li></ul></li><li>If prompted to sign into <em>github.com</em> and add your credentials: <ul><li>이것은 당신에게 달려 있습니다! Github와 IDE 간의 긴밀한 통합을 제공하여 워크플로를 단순화할 수 있습니다.</li></ul></li><li>Other prompts are optional, and may be installed if they seem useful. </li></ul><p><a id="building"></a></p><h2 id="px4-빌드" tabindex="-1">PX4 빌드 <a class="header-anchor" href="#px4-빌드" aria-label="Permalink to &quot;PX4 빌드&quot;">​</a></h2><p>빌드를 진행하려면:</p><ol><li><p>Select your build target (&quot;cmake build config&quot;):</p><ul><li><p>The current <em>cmake build target</em> is shown on the blue <em>config</em> bar at the bottom (if this is already your desired target, skip to next step). <img src="'+i+'" alt="Select Cmake build target"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The cmake target you select affects the targets offered for when <a href="#debugging">building/debugging</a> (i.e. for hardware debugging you must select a hardware target like <code>px4_fmu-v6</code>).</p></div></li></ul></li></ol><p>:::</p><ul><li><p>Click the target on the config bar to display other options, and select the one you want (this will replace any selected target).</p></li><li><p><em>Cmake</em> will then configure your project (see notification in bottom right). <img src="'+l+'" alt="Cmake config project"></p></li><li><p>Wait until configuration completes. When this is done the notification will disappear and you&#39;ll be shown the build location: <img src="'+r+'" alt="Cmake config project">.</p></li></ul><ol start="2"><li>You can then kick off a build from the config bar (select either <strong>Build</strong> or <strong>Debug</strong>). <img src="'+s+'" alt="Run debug or build"></li></ol><p>After building at least once you can now use [code completion](#code completion) and other <em>VSCode</em> features.</p><h2 id="디버깅" tabindex="-1">디버깅 <a class="header-anchor" href="#디버깅" aria-label="Permalink to &quot;디버깅&quot;">​</a></h2><p><a id="debugging_sitl"></a></p><h3 id="sitl-디버깅" tabindex="-1">SITL 디버깅 <a class="header-anchor" href="#sitl-디버깅" aria-label="Permalink to &quot;SITL 디버깅&quot;">​</a></h3><p>SITL에서 PX4를 디버깅하려면:</p><ol><li><p>Select the debug icon on the sidebar (marked in red) to display the debug panel. <img src="'+n+'" alt="Run debug"></p></li><li><p>Then choose your debug target (e.g. <em>Debug SITL (Gazebo Iris)</em>) from the top bar debug dropdown (purple box).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The debug targets that are offered (purple box) match your build target (yellow box on the bottom bar). 예를 들어, SITL 대상을 디버그하려면 빌드 대상에 SITL이 포함되어야 합니다.</p></div></li></ol><p>:::</p><ol start="3"><li>디버그 &quot;재생&quot; 화살표(상단 막대의 디버그 대상 옆 - 분홍색 상자)를 클릭하여 디버깅을 시작합니다.</li></ol><p>디버깅하는 동안 중단점을 설정하고, 코드를 건너뛰고, 그렇지 않으면 정상적으로 개발할 수 있습니다.</p><h3 id="하드웨어-디버깅" tabindex="-1">하드웨어 디버깅 <a class="header-anchor" href="#하드웨어-디버깅" aria-label="Permalink to &quot;하드웨어 디버깅&quot;">​</a></h3><p>The instructions in <a href="./../debug/swd_debug.html">SWD Debug Port</a> explain how to connect to the SWD interface on common flight controllers (for example, using the Dronecode or Blackmagic probes).</p><p>After connecting to the SWD interface, hardware debugging in VSCode is then the same as for <a href="#debugging_sitl">SITL Debugging</a> except that you select a debug target appropriate for your debugger type (and firmware) - e.g. <code>jlink (px4_fmu-v5)</code>.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>To see the <code>jlink</code> option you must have selected a <a href="#building-px4">cmake target for building firmware</a>.</p></div><p><img src="'+d+'" alt="Image showing hardware targets with options for the different probes"></p><p><a id="code completion"></a></p><h2 id="코드-완성" tabindex="-1">코드 완성 <a class="header-anchor" href="#코드-완성" aria-label="Permalink to &quot;코드 완성&quot;">​</a></h2><p>In order for the code completion to work (and other IntelliSense magic) you need an active configuration and to have <a href="#building">built the code</a>.</p><p>이 작업이 완료되면 다른 작업을 수행할 필요가 없습니다. 툴체인은 입력시 자동으로 기호를 제공합니다.</p><p><img src="'+p+'" alt="IntelliSense"></p><h2 id="문제-해결" tabindex="-1">문제 해결 <a class="header-anchor" href="#문제-해결" aria-label="Permalink to &quot;문제 해결&quot;">​</a></h2><p>이 섹션에는 설정 및 빌드 오류에 대한 지침이 포함되어 있습니다.</p><h3 id="ubuntu-18-04-visual-studio-code는-이-큰-작업-영역에서-파일-변경-사항을-감시할-수-없습니다" tabindex="-1">Ubuntu 18.04: &quot;Visual Studio Code는 이 큰 작업 영역에서 파일 변경 사항을 감시할 수 없습니다.&quot; <a class="header-anchor" href="#ubuntu-18-04-visual-studio-code는-이-큰-작업-영역에서-파일-변경-사항을-감시할-수-없습니다" aria-label="Permalink to &quot;Ubuntu 18.04: &quot;Visual Studio Code는 이 큰 작업 영역에서 파일 변경 사항을 감시할 수 없습니다.&quot;&quot;">​</a></h3><p>이 오류는 시작시에 나타납니다. On some systems, there is an upper-limit of 8192 file handles imposed on applications, which means that VSCode might not be able to detect file modifications in <code>/PX4-Autopilot</code>.</p><p>메모리 소비를 희생시키면서 오류를 방지하기 위해 이 제한을 늘릴 수 있습니다. Follow the <a href="https://code.visualstudio.com/docs/setup/linux#_visual-studio-code-is-unable-to-watch-for-file-changes-in-this-large-workspace-error-enospc" target="_blank" rel="noreferrer">instructions here</a>. 값 65536이면 충분합니다.</p>',43)]))}const I=c(g,[["render",f]]);export{P as __pageData,I as default};
